import {legacy_createStore as createStore} from 'redux';

const patientData = {
    patientName: null,
    pickupAddress: null,
    pickupTime: null,
    pickupNotes:null,
    optimumDriversList: []
}

const reducer = (state=patientData, action) => {

    switch(action.type) {

        case "SETPATIENTDATA":
            return{
                ...state, 
                patientName:action.payload.id,
                pickupAddress:action.payload.patientPickupAddress,
                pickupTime:action.payload.patientPickupTime,
                pickupNotes:action.payload.patientNotes,
                optimumDriversList:action.payload.optimumDriversList
            }

        default:
            return state
    }
}

export default createStore(reducer);
